import { Route, Routes } from 'react-router-dom';
import '../styles/App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import ProductList from './ProductList';
import ProductDetail from './ProductDetail'; // Utilisez le nom correct ici

import Nav from './NavBar';
import Header from './Header';
import { useState, useEffect } from 'react';

function App() {
  return (
    <div className="App">
      <Nav />
      <Header />
      <Routes>
        <Route path="/" exact element={<ProductList />} /> {/* Utilisez "element" au lieu de "component" */}
        <Route path="/product/:productId" exact element={<ProductDetail />} /> {/* Utilisez "element" au lieu de "component" */}
      </Routes>
    </div>
  );
}

export default App;
